// SPDX-License-Identifier: MIT

pragma solidity 0.6.12;

interface Auction {
    function distributeTokens(address addr) external;
}

contract Multi {
    function dave(Auction target, address[] calldata addresses) external {
        for (uint i = 0; i < addresses.length; i++) {
            target.distributeTokens(addresses[i]);
        }
    }
}
